import React, { FC } from 'react';
import styled from 'styled-components';
import theme from '../../theme';

const Holder = styled.div`
  line-height: 1.5;
  text-align: center;
  font-size: 3rem;
  ${theme.fontFamily.logo};
`;

interface IProps {
  className?: string;
}

const Logo: FC<IProps> = ({className}) => (
  <Holder className={className}>
    R
  </Holder>
);

export default Logo;
